        // Rolling window data will be stored here
        // Each entry: { t, x, y, z, alpha, beta, gamma }
        const dataBuffer = [];
        let alpha = 0, beta = 0, gamma = 0; // orientation placeholders

        // Duration of rolling window in milliseconds
        const ROLLING_WINDOW_MS = 1000;

        // Listen for orientation (alpha, beta, gamma)
        if (window.DeviceOrientationEvent) {
            window.addEventListener("deviceorientation", (event) => {
                alpha = event.alpha || 0;
                beta = event.beta || 0;
                gamma = event.gamma || 0;
            });
        } else {
            console.warn("DeviceOrientationEvent not supported on this device/browser.");
        }

        // Listen for motion (acceleration)
        if (window.DeviceMotionEvent) {
            window.addEventListener("devicemotion", (event) => {
                const now = performance.now();

                // Acceleration might be null if not supported, so we default to 0
                const ax = event.acceleration && event.acceleration.x ? event.acceleration.x : 0;
                const ay = event.acceleration && event.acceleration.y ? event.acceleration.y : 0;
                const az = event.acceleration && event.acceleration.z ? event.acceleration.z : 0;

                // Push the new sample into our buffer
                dataBuffer.push({
                    t: now,
                    x: ax,
                    y: ay,
                    z: az,
                    alpha: alpha,
                    beta: beta,
                    gamma: gamma
                });

                // Remove any samples older than ROLLING_WINDOW_MS from the buffer
                while (dataBuffer.length > 0 && (now - dataBuffer[0].t) > ROLLING_WINDOW_MS) {
                    dataBuffer.shift();
                }

                // Only compute stats if we have enough data
                if (dataBuffer.length > 0) {
                    // Compute statistics for each axis
                    const statsX = computeStats(dataBuffer.map(d => d.x));
                    const statsY = computeStats(dataBuffer.map(d => d.y));
                    const statsZ = computeStats(dataBuffer.map(d => d.z));
                    const statsA = computeStats(dataBuffer.map(d => d.alpha));
                    const statsB = computeStats(dataBuffer.map(d => d.beta));
                    const statsG = computeStats(dataBuffer.map(d => d.gamma));

                    // Build feature array in the order you prefer
                    // e.g. [meanX, varX, minX, maxX, medianX, meanY, varY, ..., meanG, varG, ...]
                    const featureArray = [
                        statsX.mean, statsX.variance, statsX.min, statsX.max, statsX.median,
                        statsY.mean, statsY.variance, statsY.min, statsY.max, statsY.median,
                        statsZ.mean, statsZ.variance, statsZ.min, statsZ.max, statsZ.median,
                        statsA.mean, statsA.variance, statsA.min, statsA.max, statsA.median,
                        statsB.mean, statsB.variance, statsB.min, statsB.max, statsB.median,
                        statsG.mean, statsG.variance, statsG.min, statsG.max, statsG.median
                    ];

                    // predict activity
                    const prediction = score(featureArray);

                    const activity = evaluateScore(prediction)

                    // Display the result
                    const predictionEl = document.getElementById("prediction");
                    predictionEl.textContent = "Prediction: " + activity;
                }
            });
        } else {
            console.warn("DeviceMotionEvent not supported on this device/browser.");
        }

        /**
         * Given an array of numbers, compute mean, variance, min, max, median.
         */
        function computeStats(array) {
            if (array.length === 0) {
                return { mean: 0, variance: 0, min: 0, max: 0, median: 0 };
            }

            // Mean
            const mean = array.reduce((acc, val) => acc + val, 0) / array.length;

            // Variance
            let variance = 0;
            for (const val of array) {
                variance += (val - mean) ** 2;
            }
            variance = variance / array.length;

            // Min, Max
            const minVal = Math.min(...array);
            const maxVal = Math.max(...array);

            // Median
            const sorted = array.slice().sort((a, b) => a - b);
            let median;
            if (sorted.length % 2 === 0) {
                // average of middle two
                const midIndex = sorted.length / 2;
                median = (sorted[midIndex - 1] + sorted[midIndex]) / 2;
            } else {
                // middle element
                median = sorted[Math.floor(sorted.length / 2)];
            }

            return {
                mean: mean,
                variance: variance,
                min: minVal,
                max: maxVal,
                median: median
            };
        }

        function evaluateScore(probArray) {
            // Find the index of the highest number
            let maxIndex = 0;
            let maxVal = probArray[0];

            for (let i = 1; i < probArray.length; i++) {
                if (probArray[i] > maxVal) {
                    maxVal = probArray[i];
                    maxIndex = i;
                }
            }

            // Map index to activity
            switch (maxIndex) {
                case 0: return "sitting";
                case 1: return "walking";
                case 2: return "standing";
                default: return "unknown";
            }
        }
